const Home = () => {
  return (
    <>
      <h1>FootyScores</h1>
      <hr />
      <h2>Top Scorers</h2>
      <hr />
      <h2>Previous Result</h2>
      <hr />
      <h2>Next Match</h2>
    </>
  );
};

export default Home;
